create database [Trade]
go
use [Trade]
go
create table [Role]
(
	RoleID int primary key identity,
	RoleName nvarchar(100) not null
)
go
create table [User]
(
	UserID int primary key identity,
	UserFIO nvarchar(300) not null,
	UserLogin nvarchar(500) not null,
	UserPassword nvarchar(6) not null,
	UserRole int foreign key references [Role](RoleID)
)
go
create table PickupPoint
(
	PointID int primary key identity,
	Adress nvarchar(1000)
)
go
create table OrderStatus
(
	StatusName nvarchar(20) primary key
)
go
create table [Order]
(
	OrderID int primary key identity,
	OrderDate datetime not null,
	OrderDeliveryDate datetime not null,
	OrderPickupPoint int foreign key references PickupPoint(PointID) not null,
	UserReceiverID int foreign key references [User](UserID) null,
	OrderReceivingCode int not null,
	OrderStatus nvarchar(20) foreign key references OrderStatus(StatusName) not null
)
go
create table Manufacturer
(
	ManufacturerName nvarchar(200) primary key
)
go
create table Provider
(
	ProviderName nvarchar(200) primary key
)
go
create table MeasurementUnits
(
	MeasurementUnitName nvarchar(10) primary key
)
go
create table Category
(
	CategoryName nvarchar(30) primary key
)
go
create table Product
(
	ProductArticleNumber nvarchar(6) primary key,
	ProductName nvarchar(300) not null,
	ProductMeasurementUnitName nvarchar(10) foreign key references MeasurementUnits(MeasurementUnitName),
	ProductCost decimal(19,4) not null,
	ProductDiscountMaxPossible tinyint null,
	ProductManufacturerName nvarchar(200) foreign key references Manufacturer(ManufacturerName),
	ProductProviderName nvarchar(200) foreign key references Provider(ProviderName),
	ProductCategory nvarchar(30) foreign key references Category(CategoryName) not null,
	ProductDiscountAmount tinyint null,
	ProductQuantityInStock int not null,
	ProductDescription nvarchar(4000) not null,
	ProductPhoto image null
)
go
create table OrderProduct
(
	OrderID int foreign key references [Order](OrderID) not null,
	ProductArticleNumber nvarchar(6) foreign key references Product(ProductArticleNumber) not null,
	ProductCount int,
	Primary key (OrderID,ProductArticleNumber)
)
GO
